// Fun√ß√£o para converter respostas_json para formato leg√≠vel
function formatarRespostas(respostasJson) {
  let respostas;

  // Se j√° √© um objeto, usa diretamente. Se √© string, faz parse
  if (typeof respostasJson === 'string') {
    try {
      respostas = JSON.parse(respostasJson);
    } catch (e) {
      console.log('Erro ao fazer parse do JSON:', e);
      return {
        modeloNegocio: '',
        tamSamSom: '',
        pesquisaQualitativa: '',
        concorrentes: '',
        persona: '',
        pitch: '',
        programasAnteriores: ''
      };
    }
  } else {
    respostas = respostasJson;
  }

  // Fun√ß√£o auxiliar para converter valores booleanos
  const formatarBoolean = (valor) => {
    if (valor === true) return 'Sim';
    if (valor === false) return 'N√£o';
    if (valor === '') return 'N√£o Informado';
    return valor || 'N√£o Informado';
  };

  // Fun√ß√£o para formatar pesquisa e concorrentes
  const formatarPesquisa = (valor) => {
    switch (valor) {
      case 'nao_realizei': return 'N√£o Realizei';
      case 'informal': return 'Informal';
      case 'dados_organizados': return 'Dados Organizados';
      default: return valor || 'N√£o Informado';
    }
  };

  return {
    modeloNegocio: formatarBoolean(respostas.modeloNegocio),
    tamSamSom: formatarBoolean(respostas.tamSamSom),
    pesquisaQualitativa: formatarPesquisa(respostas.pesquisaQualitativa),
    concorrentes: formatarPesquisa(respostas.concorrentes),
    persona: formatarBoolean(respostas.persona),
    pitch: formatarBoolean(respostas.pitch),
    programasAnteriores: formatarBoolean(respostas.programasAnteriores)
  };
}

// Fun√ß√£o para formatar campos diretos do Supabase
function formatarCamposDirectos(dados) {
  // Fun√ß√£o para normalizar respostas diretas
  const normalizarResposta = (valor) => {
    if (valor === null || valor === undefined || valor === '') return 'N√£o Informado';

    const valorStr = String(valor).toLowerCase().trim();

    // Para campos boolean/sim/n√£o
    if (valorStr === 'sim' || valorStr === 'true') return 'Sim';
    if (valorStr === 'n√£o' || valorStr === 'nao' || valorStr === 'false') return 'N√£o';

    // Para pesquisa qualitativa
    if (valorStr.includes('informalmente sem dados') || valorStr.includes('informal')) return 'Informal';
    if (valorStr.includes('dados organizados')) return 'Dados Organizados';
    if (valorStr.includes('ainda n√£o realizei') || valorStr.includes('n√£o realizei')) return 'N√£o Realizei';

    // Para mapeamento concorrentes
    if (valorStr.includes('fiz informalmente') || valorStr.includes('informal')) return 'Informal';

    return String(valor).trim() || 'N√£o Informado';
  };

  return {
    modeloNegocio: normalizarResposta(dados['Plano de neg√≥cios']),
    tamSamSom: normalizarResposta(dados['TamSamSom']),
    pesquisaQualitativa: normalizarResposta(dados['Pesquisa qualitativa:']),
    concorrentes: normalizarResposta(dados['Mapeamento concorrentes']),
    persona: normalizarResposta(dados['Persona']),
    pitch: normalizarResposta(dados['Pitch']),
    programasAnteriores: normalizarResposta(dados['Programas'])
  };
}

// Fun√ß√£o para formatar resultado
function formatarResultado(resultado) {
  switch (resultado) {
    case 'Trilha Inicial': return 'Trilha Inicial';
    case 'Trilha Avan√ßada': return 'Trilha Avan√ßada';
    case 'Aprovado para Incuba√ß√£o': return 'Aprovado para Incuba√ß√£o';
    case 'aprovado_incubacao': return 'Aprovado para Incuba√ß√£o';
    case 'trilha_inicial': return 'Trilha Inicial';
    case 'trilha_avancada': return 'Trilha Avan√ßada';
    default: return resultado || 'N√£o Definido';
  }
}

// Fun√ß√£o para formatar status
function formatarStatus(status) {
  switch (status) {
    case 'trilha_inicial': return 'Trilha Inicial';
    case 'trilha_avancada': return 'Trilha Avan√ßada';
    case 'aprovado_incubacao': return 'Aprovado Incuba√ß√£o';
    default: return status || 'N√£o Definido';
  }
}

// Fun√ß√£o para formatar data
function formatarData(dataIso) {
  if (!dataIso) return 'N√£o Informado';

  try {
    const data = new Date(dataIso);
    return data.toLocaleDateString('pt-BR') + ' ' + data.toLocaleTimeString('pt-BR', { 
      hour: '2-digit', 
      minute: '2-digit' 
    });
  } catch (e) {
    return 'Data Inv√°lida';
  }
}

// Processar os dados do Supabase
const dadosFormatados = [];

for (const item of $input.all()) {
  const dados = item.json;

  // Primeiro tenta usar os campos diretos do Supabase
  let respostasFormatadas = formatarCamposDirectos(dados);

  // Se os campos diretos est√£o vazios/null, usa o respostas_json como fallback
  const temCamposDirectos = Object.values(respostasFormatadas).some(valor => valor !== 'N√£o Informado');

  if (!temCamposDirectos && dados.respostas_json) {
    respostasFormatadas = formatarRespostas(dados.respostas_json);
  }

  dadosFormatados.push({
